const Route = require("../Models/Route");
const bcrypt = require('bcrypt');
const sql = require("mssql");
var config = require('../../dbconfig');


async function getRoutes() {
    try {
        let pool = await sql.connect(config);
        let routes = await pool.request().query("SELECT * from [Route]");
        return routes.recordsets;
    } catch (error) {
        console.log(error);
        throw new Error('Failed to fetch routes.');
    }
}

async function getPoiList() {
    try {
        let pool = await sql.connect(config);
        let poi_list = await pool.request().query("SELECT * from [POI]");
        return poi_list.recordsets[0];
    } catch (error) {
        console.log(error);
        throw new Error('Failed to fetch poi_list.');
    }
}

async function addRouteFromTourist(name, city, category, created) {
    try {
        let pool = await sql.connect(config);
        let result = await pool.request()
            .input('name', sql.NVarChar(255), name)
            .input('city', sql.NVarChar(255), city)
            .input('category', sql.NVarChar(255), category)
            .input('created', sql.Int, created)
            .query(`INSERT INTO [Route] (name, city, category, created, image) 
            VALUES (@name, @city, @category, @created, '');
            SELECT SCOPE_IDENTITY() AS RouteId`);

                     
        
            const routeId = result.recordset[0].RouteId;
            return { success: true, message: 'Rota adicionada com sucesso.', routeId: routeId };
    } catch (error) {
        console.log(error);
        throw new Error('Failed to add route.');
    }
}

async function addPoiToRoute(route_id, order_in_route, id) {
    try {
        let pool = await sql.connect(config);
        // Consulta para obter os dados do POI com o ID fornecido
        let queryResult = await pool.request()
            .input('id', sql.Int, id)
            .query('SELECT * FROM [POI] WHERE id = @id');

        // Verifica se o POI com o ID fornecido existe
        if (queryResult.recordset.length === 0) {
            throw new Error('POI not found with the provided ID.');
        }

        // Obtém os dados do POI encontrado
        const poiData = queryResult.recordset[0];

        
        // Atualiza os dados do POI para definir o novo route_id
        poiData.route_id = route_id;
        poiData.order_in_route = order_in_route;
        delete poiData.id; // Remove o ID para que seja atribuído automaticamente

        // Insere um novo POI com os dados atualizados
        let insertResult = await pool.request()
            .input('route_id', sql.Int, poiData.route_id)
            .input('name', sql.NVarChar(255), poiData.name)
            .input('description', sql.NVarChar(255), poiData.description)
            .input('order_in_route', sql.Int, poiData.order_in_route)
            .input('category', sql.NVarChar(255), poiData.category)
            .input('latitude', sql.Decimal(9, 6), poiData.latitude)
            .input('longitude', sql.Decimal(9, 6), poiData.longitude)
            .input('altitude', sql.Decimal(9, 6), poiData.altitude)
            .input('creator_name', sql.NVarChar(255), poiData.creator_name)
            .input('architectural_style', sql.NVarChar(255), poiData.architectural_style)
            .input('website', sql.NVarChar(255), poiData.website)
            .input('opening_hours', sql.NVarChar(255), poiData.opening_hours)
            .input('rating', sql.Int, poiData.rating)
            .input('city', sql.NVarChar(255), poiData.city)
            .query('INSERT INTO [POI] (route_id, name, description, order_in_route, category, latitude, longitude, altitude, creator_name, architectural_style, website, rating, city) VALUES (@route_id, @name, @description, @order_in_route, @category, @latitude, @longitude, @altitude, @creator_name, @architectural_style, @website, @rating, @city); SELECT SCOPE_IDENTITY() AS NewPOIId');

        // Verifica se a inserção foi bem-sucedida
        if (insertResult.recordset && insertResult.recordset.length > 0) {
            const newPOIId = insertResult.recordset[0].NewPOIId;
            return { success: true, message: 'POI adicionado à rota com sucesso.', newPOIId: newPOIId };
        } else {
            throw new Error('Failed to add POI to route.');
        }
    } catch (error) {
        console.error(error);
        throw new Error('Failed to add POI to route.');
    }
}


async function getRouteDetails(routeId) {
    try {
        let pool = await sql.connect(config);

        // Obter detalhes da rota
        let routeResult = await pool.request()
            .input('routeId', sql.Int, routeId)
            .query('SELECT * FROM Route WHERE id = @routeId');

        let route = routeResult.recordset[0];

        // Obter lista de POI da rota
        let poiResult = await pool.request()
            .input('routeId', sql.Int, routeId)
            .query('SELECT * FROM POI WHERE route_id = @routeId');

        let poiList = poiResult.recordset;

        // Combinar detalhes da rota e lista de POI
        let routeDetails = {
            route: route,
            poiList: poiList
        };

        return routeDetails;
    } catch (error) {
        console.log(error);
        throw new Error('Failed to fetch route details.');
    }
}

module.exports = {
    getRoutes: getRoutes,
    getPoiList: getPoiList,
    getRouteDetails: getRouteDetails,
    addRouteFromTourist: addRouteFromTourist,
    addPoiToRoute: addPoiToRoute
}
